import React, { Component } from 'react'
import Header from './Header'
import { Switch,Route } from 'react-router-dom'
import Navigation from './Navigation'
import './index.css'

export default class List extends Component {
    render() {
        return (
            <div>
                <Header></Header>
                <Navigation></Navigation>
                <Switch>
                    <Route path="'"></Route>
                    <Route></Route>
                    <Route></Route>
                </Switch>
            </div>
        )
    }
}
